import React from 'react';
import './App.css';
import Header from "./components/common/heading/Header";
import { BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';

const App = () => {
  return (
    <>
      <Header/>
      <Router>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </>
  )
}

export default App
